export default function TableResponse({ table }) {
  if (!table) return null;
  return (
    <div className="overflow-auto my-2">
      <table className="min-w-full text-left border-collapse">
        <thead>
          <tr>
            {table.columns.map((c, i) => <th key={i} className="px-3 py-2 border-b">{c}</th>)}
          </tr>
        </thead>
        <tbody>
          {table.rows.map((r, idx) => (
            <tr key={idx} className="odd:bg-gray-50 dark:odd:bg-[#051225]">
              {r.map((cell, i) => <td key={i} className="px-3 py-2 border-b">{cell}</td>)}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
